import fetch from "isomorphic-unfetch";

const Index = props => {
  return (
    <div className="container m-4">
      <p>Hello Next.js</p>
      <p>{props[0]}</p>
    </div>
  );
};

Index.getInitialProps = async () => {
  const response = await fetch("http://localhost:5500/api/letter/1");
  const data = response.json();
  return data;
};

export default Index;
